package booking.com.backendcodesprint.hackerrank;

import java.util.*;

/**
 * Created by andrew on 22/09/16.
 */

public class EventRaffle {

    public static void main(String[] args) {
        /* Enter your code here. Read input from STDIN. Print output to STDOUT. Your class should be named Solution. */
        Scanner in = new Scanner(System.in);
        int numPerson = in.nextInt();
        in.nextLine();//numPerson is also num of events in this example
        //but to be safe, count the number of event by myself
        Set<Integer> eSet = new HashSet<>();
        //person passion set. it does not matter if id is from 0 or 1
        Map<Integer, Set<String>> pp = new HashMap<>();
        for (int i = 0; i < numPerson; i++) {
            eSet.add(in.nextInt());
            Set<String> pSet = new HashSet<String>();//person's passion set
            //ignore the person's original ticket because what matters are the common passions
            int n = in.nextInt();//num passions
            for (int z = 0; z < n; z++) {
                pSet.add(in.next());
            }
            in.nextLine();
            pp.put(i, pSet);
        }
        //event and passion
        Map<Integer, Set<String>> ep = new HashMap<Integer, Set<String>>();
        for (int i = 0; i < eSet.size(); i++) {
            Set<String> pSet = new HashSet<String>();//event's passion set
            int n = in.nextInt();
            for (int z = 0; z < n; z++) {
                pSet.add(in.next());
            }
            if (in.hasNextLine())
                in.nextLine();
            ep.put(i, pSet);
        }
        in.close();
        //now build an edmonton array
        boolean[][] connections = new boolean[eSet.size()][numPerson];
        for (int e = 0; e < eSet.size(); e++) {
            for (int p = 0; p < numPerson; p++) {
                Set<String> es = new HashSet<String>(ep.get(e));
                Set<String> ps = new HashSet<String>(pp.get(p));
                es.retainAll(ps);
                if (es.size() > 0) {
                    connections[e][p] = true;
                } else {
                    connections[e][p] = false;
                }
            }
        }
        System.out.println(maxBPM(connections));
    }

    static boolean bpm(boolean bpGraph[][], int u, boolean seen[],
                       int matchR[]) {
        int N = bpGraph[0].length;
        // Try every job one by one
        for (int v = 0; v < N; v++) {
            // If applicant u is interested in job v and v
            // is not visited
            if (bpGraph[u][v] && !seen[v]) {
                seen[v] = true; // Mark v as visited

                // If job 'v' is not assigned to an applicant OR
                // previously assigned applicant for job v (which
                // is matchR[v]) has an alternate job available.
                // Since v is marked as visited in the above line,
                // matchR[v] in the following recursive call will
                // not get job 'v' again
                if (matchR[v] < 0 || bpm(bpGraph, matchR[v],
                        seen, matchR)) {
                    matchR[v] = u;
                    return true;
                }
            }
        }
        return false;
    }

    // Returns maximum number of matching from M to N
    static long maxBPM(boolean bpGraph[][]) {
        final int M = bpGraph.length;
        final int N = bpGraph[0].length;
//this is explaned assuming left vertices are jobs and right vertices are applicants.

        // An array to keep track of the applicants assigned to
        // jobs. The value of matchR[i] is the applicant number
        // assigned to job i, the value -1 indicates nobody is
        // assigned.
        // M is number of applicants and N is number of jobs

        int matchR[] = new int[N];

        // Initially all jobs are available
        for (int i = 0; i < N; ++i)
            matchR[i] = -1;

        long result = 0; // Count of jobs assigned to applicants
        for (int u = 0; u < M; u++) {
            // Mark all jobs as not seen for next applicant.
            boolean seen[] = new boolean[N];
            for (int i = 0; i < N; ++i)
                seen[i] = false;

            // Find if the applicant 'u' can get a job
            if (bpm(bpGraph, u, seen, matchR))
                result++;
        }
        return result;
    }
}
